import React from "react";

import "./profile.css";
import { Link } from "react-router-dom";
export default function DropDownProfile() {
  return (
    <>
      <div className="profile-drop-down">
        <ul>
          <li>MyAccount</li>
          <li>
            <Link to="/cart">Cart</Link>
          </li>
          <li>Setting</li>
          <li onClick={() => window.location.reload()}>Logout</li>
        </ul>
      </div>
    </>
  );
}
